import React, {Component} from 'react';
import './About.css';
import scrollToComponent from 'react-scroll-to-component';

class About extends Component {

	componentDidMount() {
		scrollToComponent(this.Violet, {offset: 0, align: 'middle', duration: 500, ease: 'inCirc'});
	}

	render() {
		return (
			<div id={'about'} className={'about'} ref={(section) => { this.Violet = section; }}>
				<div className={'heading'}>
					<h1 className={'heading-text'}>About</h1>
				</div>
				<div className={'content'}>
					<div className={'left-content content-box'}>
						<div className={'title'}>
							<p className={'text'}>EDUCATION</p>
							<p className={'box-heading'}>COLLEGE OF APPLIED TECHNOLOGY SCIENCE</p>
							<p className={'text'}>Course : Information Technologies</p>
							<p className={'text'}>Degree : bachelor</p>
						</div>
					</div>
					<div className={'right-content content-box'}>
						<div className={'title'}>
							<p className={'text'}>WORKING EXPERIENCE</p>
							<p className={'box-heading'}>ALT - E - SOLUTIONS</p>
							<p className={'text'}>Position : Full Stack Web Developer</p>
							<p className={'text'}>May 2019 - Present</p>
						</div>
					</div>
				</div>
			</div>
		);
	}
}

export default About;
